import Layout from "../components/Layout";
import Link from "next/link";
import axios from "axios";

const PostLink = (props) => (
  <li>
    <Link href="/p/[id]" as={`/p/${props.id}`}>
      <a>{props.id}</a>
    </Link>
  </li>
);

const Index = (props) => {
  return (
    <Layout>
      <h1>XKCD API</h1>
      <ul>
        <PostLink id="foo" />
        <PostLink id="bar" />
        <PostLink id="baz" />
      </ul>
    </Layout>
  );
};

